import React from "react";
import Logo from "./Logo";
import Nav from "./Nav";
import { withRouter } from "react-router-dom";

const Header = location => (
  <div className={`header ${window.location.pathname === "/" ? "homepage" : ""}`}>
    <Logo />
    <Nav />
  </div>
);

export default withRouter(Header);
